// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract ProfessorRating {
    struct Rating {
        uint8 score;
        string comment;
    }

    mapping(address => mapping(uint => Rating)) public ratings; // student address => (professor ID => Rating)

    event RatingSubmitted(address indexed student, uint indexed professorId, uint8 score, string comment);

    function submitRating(uint professorId, uint8 score, string memory comment) public {
        require(score >= 1 && score <= 5, "Score must be between 1 and 5.");
        ratings[msg.sender][professorId] = Rating(score, comment);
        emit RatingSubmitted(msg.sender, professorId, score, comment);
    }

    function getRating(uint professorId) public view returns (uint8, string memory) {
        Rating memory rating = ratings[msg.sender][professorId];
        return (rating.score, rating.comment);
    }
}
